import React from 'react';
import app from '../styles/LandingPage.module.css';

const Section = (props) => {
  const {column, transparent, header, naked, children} = props;
  const classname = column ? 'section-column' : 'section--row';

  transparent ? classname += '-transparent' : null;
  
  return(
    <section className={app[classname]}>
      {children}
    </section>
  )
};

export default Section;
